// src/components/TextDisplay.jsx
import React from "react";
import "./TextDisplay.css";

export default function TextDisplay({ altitude, his, adi }) {
  return (
    <div className="text-display">
      <div className="text-box">
        <p>Altitude</p>
        <span>{altitude}</span>
      </div>
      <div className="text-box">
        <p>HIS</p>
        <span>{his}</span>
      </div>
      <div className="text-box">
        <p>ADI</p>
        <span>{adi}</span>
      </div>
    </div>
  );
}
